import React from 'react';



import './Home.css'


const Home = () => {
    return (
        <div>
            
            {ProductsData.map( products => (
     
     <Cards 
     img={products.img} 
     key={products.id} 
     name={products.name} 
     price={products.price}
     ammount={products.ammount} 
     descripcion={" "} /> 
     
     ))}
 
            
        </div>
    );
}

export default Home;
